from aiogram import typesfrom aiogram.types import InlineKeyboardButton, InlineKeyboardMarkup, ReplyKeyboardMarkup, KeyboardButton#KeyboardButton(text='Comfy-Wacom'), KeyboardButton(text='Comfy-XP-Pen') KeyboardButton(text='Artline(coming soon :))'), KeyboardButton(text="Rozetka")#KeyboardButton(text='WacomStore'), KeyboardButton(text='Comfy') (KeyboardButton(text='F.ua')), KeyboardButton(text='MTA')def get_custom_keyboard():    buttons = [        [KeyboardButton(text="Foxtrot"), KeyboardButton(text="Moyo"), KeyboardButton(text="KTC")],        [KeyboardButton(text="Auchan"), KeyboardButton(text="Click"), KeyboardButton(text='Citrus')],        [KeyboardButton(text='Setevuha'), KeyboardButton(text='WO'), KeyboardButton(text='CAN')],        [KeyboardButton(text='ItBox'),  KeyboardButton(text='EXE'), KeyboardButton(text='Portativ')],        [KeyboardButton(text='Comtrading'), KeyboardButton(text='Brain')],    ]    keyboard = ReplyKeyboardMarkup(keyboard=buttons, resize_keyboard=True)    return keyboard